function: "Another mashup. If anyone has supports working well enough, I would love to see this printed.\r\n\r\nEdit: whistle version added. Blame tbuser.\r\n\r\nEdit: Added pics of a print WITHOUT SUPPORTS! And no cleanup. When it tried to print the bottom of the tentacles, it just kinda made a mess, but that mess built up enough to become a support structure in mid-air. This structure was initially flexible, and was dragged around by the head for a few layers, which is why the tentacles are pointy even though the bottoms were cut off by this. Even the stringing looks appropriate. I am ecstatic about how this came out.\r\n\r\nThis Thing is a mashup of:\r\n\xE2\u20AC\xA2Octopus by MaskedRetriever - http://www.thingiverse.com/thing:5963\r\n\xE2\u20AC\xA2The Pink Panther Woman!!!! by januario - http://www.thingiverse.com/thing:1216\r\n\xE2\u20AC\xA2Thin Profile Whistle Blank by TeamTeamUSA - http://www.thingiverse.com/thing:5416"
